import styled from "styled-components";
function Header() {
    const HeaderContainer = styled.div`
        background : black;
        color   :   white;
        padding :   24px 24px;
        display :   flex;
        flex-direction  :   row;
    `;

    return (
    <div>
    <HeaderContainer>Hello</HeaderContainer>
    </div>
  );
}

export default Header;
